import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoginPage from './components/Login_page'; // Your login page
import AdminDashboard from './components/AdminDashboard'; // Protected admin page
import PrivateRoute from './components/PrivateRoute'; // Import the PrivateRoute

function App() {
  return (
    <Router>
      <Routes>
        {/* Public routes */}
        <Route path="/login" element={<LoginPage />} />

        {/* Protected routes */}
        <Route 
          path="/admin" 
          element={
            <PrivateRoute>
              <AdminDashboard /> {/* Only accessible if authenticated */}
            </PrivateRoute>
          } 
        />

        {/* Add more protected routes */}
        <Route 
          path="/assign-roles" 
          element={
            <PrivateRoute>
              <AssignRoles /> {/* Example protected route */}
            </PrivateRoute>
          } 
        />
      </Routes>
    </Router>
  );
}

export default App;
